webpackJsonp([46077048270718],{467:function(A,e){A.exports={data:{site:{siteMetadata:{title:"ourbucketl.ist",author:"Dan Rose & Sophie Mellissa"}},markdownRemark:{id:"C:/Users/danja/OneDrive/Documents/GitHub/ourbucketl.ist/src/pages/taupo/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>“Those who don’t jump will never fly.”</p>\n</blockquote>\n<p>Leena Ahmad Almashat.</p>\n<h2>Taupo</h2>\n<p>The journey from Rotorua to Taupo was a quick one, but made longer by a 25 minute stop just outside the city, at a petrol station. We were starting to remember what the benefits of driving in New Zealand would have been very quickly. Although a city, Taupo was more the size of a bigger town in the UK. We stayed at <a href="http://www.rainbowlodge.co.nz/">Rainbow Lodge</a> and we were lucky enough to get a dormitory to ourselves, one of the perks of travelling in New Zealand winter. The owner was lovely, from Glasgow but he had lived in New Zealand for the last 16 years. He had a dog called Jess who was really affectionate and pinned down your arm with her paws to make sure you kept stroking her and couldn’t get away.</p>\n<p>We had a wander around the city on our last afternoon in Taupo and found lots of street art in the back allies which had been produced as part of a <a href="https://www.google.co.nz/search?q=graffiti+taupo&#x26;oq=graffiti+taupo&#x26;aqs=chrome..69i57j69i60l3j69i59l2.2590j0j4&#x26;sourceid=chrome&#x26;ie=UTF-8">Graffiato</a>. The graffiti looked new and there was barely any tagging around the city. We also went out for a meal in Taupo, as we had mainly cooked due to the well equipped kitchens and western supermarkets. We went to a curry place called <a href="https://malabartaupo.com/">Malabar</a> and it was the most similar to the ones we have at home.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/graffiti-8fa77bbbeb6abff1b6aaf39026ce70ac-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Graffiti"\n        title="Graffiti"\n        src="/static/graffiti-8fa77bbbeb6abff1b6aaf39026ce70ac-769ec.jpg"\n        srcset="/static/graffiti-8fa77bbbeb6abff1b6aaf39026ce70ac-d9ef2.jpg 225w,\n/static/graffiti-8fa77bbbeb6abff1b6aaf39026ce70ac-ac97c.jpg 450w,\n/static/graffiti-8fa77bbbeb6abff1b6aaf39026ce70ac-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Skydive</h2>\n<p>Skydiving has been on my bucketlist since I learned what it was and as we were heading to the adrenaline capital of the world, it made sense to do a skydive in New Zealand. Dan point blank refused to even entertain the idea. I booked with <a href="www.skydivetaupo.co.nz/">Skydive Taupo</a> as it was one of the cheaper places to do it and a friend had used the same company. I tried not to work myself up before, as I knew that the skydive could be cancelled due to bad weather.</p>\n<p>However, when the day came, it was partially cloudy and the limo came to pick us up on time. There were six women in total jumping the morning I did it and Dan stayed on the ground to watch. The staff took us through a safety video, made us sign to say if we die or injure ourselves it’s not their fault and then showed us the difference between the photo packages. I went with 15,000ft freefall, which meant that another person would jump with us and take pictures. In total it cost $529 (£278).</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/plane-b28ef8eab45134ccc9eb405ae7fdea10-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Plane"\n        title="Plane"\n        src="/static/plane-b28ef8eab45134ccc9eb405ae7fdea10-769ec.jpg"\n        srcset="/static/plane-b28ef8eab45134ccc9eb405ae7fdea10-d9ef2.jpg 225w,\n/static/plane-b28ef8eab45134ccc9eb405ae7fdea10-ac97c.jpg 450w,\n/static/plane-b28ef8eab45134ccc9eb405ae7fdea10-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I met my instructor Damo M, got suited and harnessed up before heading out to the plane. We had to sit on a bench virtually on top of one another and we were facing the back of the plane. It took around 15 minutes to reach 15000ft and at 8000ft we had to wear oxygen masks for safety reasons. As we were going up we got great views of parts of Tongariro National Park and I was able to see Mount Ruapehu poking through the clouds from the sky. Damo strapped us together and it wasn’t long before the first two people dropped out of the plane and it was my turn.</p>\n<p>Damo shuffled us along the bench and I sat with my legs dangling out of the plane for a few seconds. As I had to put my head back on the instructors shoulder, I couldn’t look down so after giving Sam the cameraman a nervous/terrified smile, Damo let go and we started falling out of the sky. As we tumbled down I had the lurching feeling in my stomach until we stopped tumbling and fell on our front. Then it just felt like we were floating, although we were actually falling at 125mph! What they didn’t warn us about was how cold it was, my face went numb immediately and I couldn’t catch my breath.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/skydive-e928370bc83d389edf4c02791fbd93be-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Skydive"\n        title="Skydive"\n        src="/static/skydive-e928370bc83d389edf4c02791fbd93be-769ec.jpg"\n        srcset="/static/skydive-e928370bc83d389edf4c02791fbd93be-d9ef2.jpg 225w,\n/static/skydive-e928370bc83d389edf4c02791fbd93be-ac97c.jpg 450w,\n/static/skydive-e928370bc83d389edf4c02791fbd93be-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We freefalled for around 60 seconds and Sam took loads of photos. Considering how fast we were falling, it felt more like floating and it didn’t feel like we were pummelling to the ground. At 5000ft Damo opened the parachute and it was a slower descent to the ground. He let me help him to steer us to the ground and as there was no wind we landed pretty fast.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/parachute-c4460c536213a4a2c26b75c309c43ef9-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Parachute"\n        title="Parachute"\n        src="/static/parachute-c4460c536213a4a2c26b75c309c43ef9-769ec.jpg"\n        srcset="/static/parachute-c4460c536213a4a2c26b75c309c43ef9-d9ef2.jpg 225w,\n/static/parachute-c4460c536213a4a2c26b75c309c43ef9-ac97c.jpg 450w,\n/static/parachute-c4460c536213a4a2c26b75c309c43ef9-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>It was all over so quickly! The views had been incredible over the lake but my brain had been so busy processing what had just happened, I didn’t feel I had time to enjoy it. Skydiving was an absolute adrenaline buzz and I wouldn’t hesitate to do it again.</p>\n<h2>Tongariro Crossing</h2>\n<p>We’d booked this well in advance with <a href="https://www.adriftnz.co.nz/">Adrift</a> and we were really looking forward to an 8 hour hike through the National Park to see where Peter Jackson filmed Mordor in Lord of the Rings up close. As it was winter we had to have a guide and we’d have to use crampons and an ice axe, so we knew it would be a hike that would challenge us a little more than others we had done. However, due to the bad weather it was cancelled, there were high winds, -11C temperatures and snow storms. Adrift gave us a refund and a very good reason to return to New Zealand in the future!</p>\n<h2>Huka Falls &#x26; the Great Taupo Lake</h2>\n<p>As the Tongariro Crossing was cancelled we did a couple of free walks in the local area. We walked to Huka Falls and back which took around 2.5 hours. Huka Falls is a powerful waterfall and the water there was really blue.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/huka-falls-6e039cabc56a81e90e27989f211ceddb-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Huka Falls"\n        title="Huka Falls"\n        src="/static/huka-falls-6e039cabc56a81e90e27989f211ceddb-769ec.jpg"\n        srcset="/static/huka-falls-6e039cabc56a81e90e27989f211ceddb-d9ef2.jpg 225w,\n/static/huka-falls-6e039cabc56a81e90e27989f211ceddb-ac97c.jpg 450w,\n/static/huka-falls-6e039cabc56a81e90e27989f211ceddb-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The other was the walk on the Great Lake Walkway, we headed towards Five Mile Bay but got to around three before we headed back as the weather was turning. The side of the lake had some grey sandy beaches and some hot pools of scalding water in them. There were lots of individual looking houses overlooking the lake and plenty of parks and patches of grass for walking dogs and having BBQ’s in the summer. The lake itself was massive and we hardly walked around any of it in 4 hours.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/lake-taupo-64bedd1bb57863f2e07e9ec00406d433-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Lake Taupo"\n        title="Lake Taupo"\n        src="/static/lake-taupo-64bedd1bb57863f2e07e9ec00406d433-769ec.jpg"\n        srcset="/static/lake-taupo-64bedd1bb57863f2e07e9ec00406d433-d9ef2.jpg 225w,\n/static/lake-taupo-64bedd1bb57863f2e07e9ec00406d433-ac97c.jpg 450w,\n/static/lake-taupo-64bedd1bb57863f2e07e9ec00406d433-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Our verdict on Taupo</h2>\n<p>We liked Taupo as a city and I absolutely loved doing a skydive. We were both pretty disappointed about the Tongariro Crossing but it has given us a reason to return to New Zealand in the future, maybe in the summer months when the weather is more reliable!</p>',frontmatter:{title:"Taupo, New Zealand",date:"July 27, 2018",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.7777777777777777,src:"/static/love-taupo-cd8278b42ceee6272849eb7b9814c6df-47774.jpg",srcSet:"/static/love-taupo-cd8278b42ceee6272849eb7b9814c6df-45ad6.jpg 480w,\n/static/love-taupo-cd8278b42ceee6272849eb7b9814c6df-e2fcf.jpg 960w,\n/static/love-taupo-cd8278b42ceee6272849eb7b9814c6df-47774.jpg 1920w",sizes:"(max-width: 1920px) 100vw, 1920px"}}}}}},pathContext:{slug:"/taupo/",previous:{fields:{slug:"/rotorua/"},frontmatter:{title:"Rotorua, New Zealand"}},next:{fields:{slug:"/wellington/"},frontmatter:{title:"Wellington, New Zealand"}}}}}});
//# sourceMappingURL=path---taupo-200b7b6b61feae37cab5.js.map